import React from "react";
import Signup from "./registeration/Signup";
import Login from "./registeration/Login";
import Header from "./Header";
import Footer from "./Footer";
import { Divider, Typography } from "@mui/material";
import './Homepage.css';

function Homepage(props) {
    var isregister = props.isregister;

    if(isregister) {
        return( 
            <div className="homepage">

                <Header />

                <div className="wrap">


                    <div className="fleft">


                    <div class="card">
        <div class="card-content">
            <Login/>

            <Divider><Typography>or</Typography></Divider>

            <button class="card-button" >Create Account</button>
        </div>
    </div>
                    </div>

                    <Divider orientation="vertical" flexItem className="vertical-divider" />

                    <div className="fright">Right</div>


                </div>

                <Footer />
            </div>
        );
    } else {
        return ( <Login />);
    }
}

export default Homepage;
